INSERT INTO "item" VALUES(1,1,'Toute la matière est constituée de charges électriques.',0,1,2);
INSERT INTO "item" VALUES(2,2,'Les composants d''un circuit électrique seront appelés dipôles.',0,1,2);
INSERT INTO "item" VALUES(3,2,'Tous les dipôles d''un circuit série sont sur une seul branche (une seule boucle).',0,2,2);
INSERT INTO "item" VALUES(4,2,'Schématisation et symboles électrique',0,3,2);
INSERT INTO "item" VALUES(5,2,'Un interrupteur ouvert empêche le courant électrique de passer, il équivaut à un isolant. Un interrupteur fermé se comporte comme un conducteur.',0,4,2);
INSERT INTO "item" VALUES(6,2,'Un circuit en dérivation comporte plusieurs branches (plusieurs boucles).',0,5,2);
INSERT INTO "item" VALUES(7,2,'Une installation domestique classique est constitué d''appareils en dérivation.',0,6,2);
INSERT INTO "item" VALUES(8,3,'Le courant électrique est la circulation de charges électriques.',0,1,2);
INSERT INTO "item" VALUES(9,3,'Le circuit doit être fermé pour qu''il y ait circulation de courant électrique.',0,2,2);
INSERT INTO "item" VALUES(10,3,'Le courant électrique permet de transférer de l''énergie électrique du générateur vers les récepteurs.',0,3,2);
INSERT INTO "item" VALUES(11,3,'Le courant électrique circule de la borne plus à la borne moins de la pile.',0,4,2);
INSERT INTO "item" VALUES(12,3,'L''intensité électrique est le débit de charges par seconde.',0,5,2);
INSERT INTO "item" VALUES(13,3,'L''intensité du courant électrique se mesure en ampère grâce à un ampèremètre. L''intensité est symbolisée par la lettre I.',0,6,2);
INSERT INTO "item" VALUES(14,3,'L''intensité se mesure en un point du circuit, l''ampèremètre est conducteur et se branche en série.',0,7,2);
INSERT INTO "item" VALUES(15,3,'Les noeuds sont les points du circuit où le courant peut aller à plusieurs endroits. Une branche est une portion de circuit comprise entre deux noeuds.',0,8,2);
INSERT INTO "item" VALUES(16,3,'Les conducteurs sont parcourus par un courant sans avoir de tension à leurs bornes car les conducteurs ne consomment pas d''énergie électrique.',0,9,2);
INSERT INTO "item" VALUES(17,3,'L''intensité est la même tout au long d''une branche car tous les électrons qui entrent dans une branche en sortent.',0,10,2);
INSERT INTO "item" VALUES(18,4,'La somme des intensités qui pénètrent dans un noeud est égale à la somme des intensités qui en sortent. ',0,1,2);
INSERT INTO "item" VALUES(19,4,'Si aucun courant ne circule dans un récepteur, il ne fonctionnera pas et ne consommera aucune tension.',0,2,2);
INSERT INTO "item" VALUES(20,5,'Certains matériaux sont isolants, d''autres sont conducteurs.',0,1,2);
INSERT INTO "item" VALUES(21,5,'Les minéraux contenus dans l''eau rendent celle-ci conductrice. Tous les métaux sont conducteurs.',0,2,2);
INSERT INTO "item" VALUES(22,5,'Plus la résistance(R) d''un circuit est grande, plus l''intensité est petite.',0,3,2);
INSERT INTO "item" VALUES(23,5,'L''énergie électrique récupérée par un matériau résistant sera transformée en chaleur.',0,4,2);
INSERT INTO "item" VALUES(24,5,'La résistance se mesure en Ohm à l''aide d''un Ohmmètre. la résistance est symbolisée par la lettre R.',0,5,2);
INSERT INTO "item" VALUES(25,5,'La tension aux bornes de chaque dipôle d''un circuit série ne dépend pas de l''ordre des dipôles.',0,6,2);
INSERT INTO "item" VALUES(26,5,'L''intensité du courant dans une branche ne dépend pas de l''ordre des dipôles. La somme des résistances est la même dans la branche quelque soit l''ordre des récepteurs.',0,7,2);
INSERT INTO "item" VALUES(27,5,'Les ions conduisent le courant électrique.',0,8,2);
INSERT INTO "item" VALUES(28,6,'La tension correspond à l''énergie de chaque électron.',0,1,2);
INSERT INTO "item" VALUES(29,6,'Quand on veut connaître la tension aux bornes d''un dipôle, on mesure la différence d''énergie des électrons aux bornes de ce dipôle.',0,2,2);
INSERT INTO "item" VALUES(30,6,'La grandeur "tension électrique" a pour unité le Volt(V). La tension est symbolisée par la lettre U.',0,3,2);
INSERT INTO "item" VALUES(31,6,'La tension se mesure avec un voltmètre branché en dérivation.Le voltmètre est isolant.',0,4,2);
INSERT INTO "item" VALUES(32,6,'Une tension peut exister entre deux points d''une portion de circuit non parcourue par un courant. C''est le cas des isolants.',0,5,2);
INSERT INTO "item" VALUES(33,6,'Dans un circuit en série toute l''énergie donnée par le générateur est partagée entre les récepteurs.Donc la somme des tensions aux bornes des récepteurs est égale à la tension aux bornes du générateur.',0,6,2);
INSERT INTO "item" VALUES(34,6,'Pour fonctionner normalement, un récepteur doit avoir à ses bornes une tension proche de sa fonction nominale. Pour une tension inférieure, on parlera de sous-tension, et pour une tension supérieure de sur-tension.',0,7,2);
INSERT INTO "item" VALUES(35,6,'La tension est la même aux bornes de deux dipôles en dérivation car ils ont la même différence d''énergie à leurs bornes.',0,8,2);
INSERT INTO "item" VALUES(36,6,'La loi d''ohm indique que la tension est égale au produit de l''intensité et de la résistance.U=RI',0,9,2);
INSERT INTO "item" VALUES(37,7,'Une tension variable ne reste pas constante au cours du temps. Une tension alternative prendra des valeurs positives et négatives.',0,1,2);
INSERT INTO "item" VALUES(38,7,'Les valeurs maximales d''une tension variable seront les valeurs les plus hautes et les plus basses que prendront la tension.',0,2,2);
INSERT INTO "item" VALUES(39,7,'Une tension périodique est une tension qui est constituée d''un motif (signal)qui se répète au cours d''un certain temps. Ce temps est appelé période et est symbolisé par T. Il s''exprime en secondes.',0,3,2);
INSERT INTO "item" VALUES(40,7,'Un alternateur produit une tension alternative.',0,4,2);
INSERT INTO "item" VALUES(41,7,'La fréquence est le nombre de motifs (de signaux) par seconde. On peut la calculer en sachant que c''est l''inverse de la période.f=1/T. La fréquence s''exprime en Hertz (Hz).',0,5,2);
INSERT INTO "item" VALUES(42,7,'La valeur efficace d''un courant alternatif est la valeur pour laquelle sa tension aura la même "efficacité" qu''un courant continu. C''est ce qu''indiquera un voltmètre branché en alternatif.',0,6,2);
INSERT INTO "item" VALUES(43,7,'La tension du secteur est alternative et périodique, elle a pour fréquence 50Hz et pour tension efficace 230V.',0,7,2);
INSERT INTO "item" VALUES(44,8,'Un oscilloscope représente la tension en fonction du temps.',0,2,2);
INSERT INTO "item" VALUES(45,8,'Les sensibilités verticales et horizontales permettent de visualiser le signal comme on le souhaite.',0,3,2);
INSERT INTO "item" VALUES(46,8,'Deux ondes peuvent être affichée en même temps.',0,4,2);
INSERT INTO "item" VALUES(47,8,'Régler la position verticale et horizontale',0,5,2);
INSERT INTO "item" VALUES(48,8,'Trigger',0,6,2);
INSERT INTO "item" VALUES(49,8,'Xy',0,7,2);
INSERT INTO "item" VALUES(50,9,'Les récepteurs ont besoin d''énergie pour fonctionner.',0,1,2);
INSERT INTO "item" VALUES(51,9,'Un générateur transfère de l''énergie électrique aux récepteurs qui la convertissent en d''autres formes.',0,2,2);
INSERT INTO "item" VALUES(52,9,'Un alternateur transforme l''énergie mécanique en énergie électrique. L''alternateur est la partie commune à toutes les centrales électriques.',0,3,2);
INSERT INTO "item" VALUES(53,9,'Les sources d''énergie non renouvelables sont limitées contrairement aux sources d''énergie renouvelable.',0,4,2);
INSERT INTO "item" VALUES(54,9,'La puissance (P) nominale est l''énergie que consomme un appareil par unité de temps. Elle se mesure en Watt (W).',0,5,2);
INSERT INTO "item" VALUES(55,9,'La puissance est le produit de la tension et de l''intensité. P=U.I où U(la tension) et I (l''intensité) sont des valeurs efficaces.',0,6,2);
INSERT INTO "item" VALUES(56,9,'L''énergie est la puissance multipliée par le temps L''énergie électrique (E) transférée pendant une durée t à un appareil de puissance P est donné par E=P.t L''énergie s''exprime en Joule(J).',0,7,2);
INSERT INTO "item" VALUES(57,10,'Une photopile convertit de l''énergie lumineuse en énergie électrique.',0,1,2);
INSERT INTO "item" VALUES(58,11,'Un court-circuit aux bornes d''un générateur est dangereux.',0,1,2);
INSERT INTO "item" VALUES(59,11,'Le corps humain est conducteur.',0,2,2);
INSERT INTO "item" VALUES(60,11,'On peut empêcher le passage d''un courant électrique grâce à des isolants.',0,3,2);
INSERT INTO "item" VALUES(61,11,'Plus l''intensité dans un conducteur sera grande, plus il va chauffer. Cela peut provoquer des incendies pour des valeurs d''intensité trop importantes.',0,4,2);
INSERT INTO "item" VALUES(62,11,'Les coupe-circuits tels que fusibles ou disjoncteur servent à éviter une trop grande intensité dans un circuit.',0,5,2);
INSERT INTO "item" VALUES(63,12,'Une tension peut être obtenu par déplacement d''un aimant près d''une bobine. Le signe et la valeur de la tension dépendront du sens et de la vitesse de déplacement.',0,1,2);
INSERT INTO "item" VALUES(64,13,'L''air est un mélange de diazote(4/5) et de dioxygène (1/5)',0,1,2);
INSERT INTO "item" VALUES(65,13,'Le dioxygène est nécessaire à la vie des animaux et des plantes.',0,2,2);
INSERT INTO "item" VALUES(66,13,'La pression représente l''énergie donnée par les molécules d''un fluide (liquide ou gaz) lors des collisions contre un objet.',0,3,2);
INSERT INTO "item" VALUES(67,13,'La pression atmosphérique est de 101 300 Pa soit 1bar',0,4,2);
INSERT INTO "item" VALUES(68,13,'La pression est une grandeur qui se mesure avec un manomètre.(on dit aussi baromètres ou pressiomètre). La pression s''exprime en Pascal',0,5,2);
INSERT INTO "item" VALUES(69,13,'La pression est une force par unité de surface. On peut la calculer par la relation P=F/S où F est la force perpendiculaire à la surface S.',0,6,2);
INSERT INTO "item" VALUES(70,13,'La pression dans un liquide au repos augmente avec la profondeur.',0,7,2);
INSERT INTO "item" VALUES(71,13,'Plus la pression augmente, plus on peut dissoudre de gaz dans un liquide.',0,8,2);
INSERT INTO "item" VALUES(72,13,'Une mole de n''importe quel gaz occupera toujours 24L à 20°C et à pression atmosphérique.',0,9,2);
INSERT INTO "item" VALUES(73,13,'A température constante, le produit du volume et de la pression reste identique pour une quantité de gaz donnée. C''est la loi de Boyle-Mariotte.',0,10,2);
INSERT INTO "item" VALUES(74,14,'Le point de vue de l''observateur sera appelé référentiel.',0,1,2);
INSERT INTO "item" VALUES(75,14,'Un mouvement sera perçu différemment selon le référentiel. Le mouvement est donc relatif au référentiel.',0,2,2);
INSERT INTO "item" VALUES(76,14,'Un translation préserve l''orientation par rapport au référentiel tandis qu''une rotation est le mouvement autour d''un axe.',0,3,2);
INSERT INTO "item" VALUES(77,14,'La durée d''un mouvement ne se mesure pas de la même façon selon la précision nécessaire.',0,4,2);
INSERT INTO "item" VALUES(78,15,'L''inertie est le fait de continuer son mouvement en ligne droite et à la même vitesse si rien ne s''y oppose.',0,1,2);
INSERT INTO "item" VALUES(79,15,'Une force peut modifier la vitesse et la trajectoire d''un corps.',0,2,2);
INSERT INTO "item" VALUES(80,15,'Une force se représente par une flèche partant du point d''application dont la longueur dépend de l''intensité de la force.',0,3,2);
INSERT INTO "item" VALUES(81,15,'Plus la masse d''un corps est importante, plus son inertie l''est aussi.',0,4,2);
INSERT INTO "item" VALUES(82,16,'Tous les objets qui ont une masse attirent les autres objets qui ont une masse.',0,1,2);
INSERT INTO "item" VALUES(83,16,'La gravitation, comme les autres forces, est une action mutuelle. Quand deux corps s''attirent via la gravitation, le premier attire le second autant que le second attire le premier.',0,2,2);
INSERT INTO "item" VALUES(84,16,'Plus la masse est importante, plus l''attraction gravitationnelle est importante.',0,3,2);
INSERT INTO "item" VALUES(85,16,'Plus les objets massifs sont loin, moins la force gravitationnelle qui les attire est forte.',0,4,2);
INSERT INTO "item" VALUES(86,16,'La gravitation est la force organisant le mouvement des planètes,des étoiles et des galaxies entre elles.',0,5,2);
INSERT INTO "item" VALUES(87,16,'Le poids est l''attraction qu''une planète fait ressentir à tout corps à sa surface.',0,6,2);
INSERT INTO "item" VALUES(88,16,'Le poids est une force et s''exprime en Newton. Cette grandeur est différente de la masse.',0,7,2);
INSERT INTO "item" VALUES(89,16,'P=m.g Le poids(en N) est le produit de la masse (en kg) et de l''intensité de la pesanteur (en N/kg) .',0,8,2);
INSERT INTO "item" VALUES(90,16,'L''intensité de la pesanteur (g) dépend de la planète ou du satellite étudié. Plus la planète sera grosse et dense, plus g sera grand.',0,9,2);
INSERT INTO "item" VALUES(91,16,'La force de gravitation universelle se calcule par F=G.m1.m2/(d²)',0,10,2);
INSERT INTO "item" VALUES(92,17,'Toutes les planètes du système solaire tournent autour du Soleil.',0,1,2);
INSERT INTO "item" VALUES(93,17,'Les satellites des planètes gravitent autour des planètes. La Lune tourne autour de la Terre sur une orbite inclinée par rapport à l''orbite de la Terre autour du Soleil.',0,2,2);
INSERT INTO "item" VALUES(94,17,'Toutes les planètes sont attirées par le Soleil mais restent à distance à cause de l''inertie qui les entraîne loin du Soleil.',0,3,2);
INSERT INTO "item" VALUES(95,18,'Un objet possède une énergie de position proportionnelle à sa hauteur,on la nommera Energie potentielle de pesanteur.',0,1,2);
INSERT INTO "item" VALUES(96,18,'L''énergie cinétique est l''énergie de la vitesse, elle n''existe que si l''objet a une vitesse.',0,2,2);
INSERT INTO "item" VALUES(97,18,'Les énergies se mesurent en Joule (J).',0,3,2);
INSERT INTO "item" VALUES(98,18,'Au cours d''une chute sans frottement, l''énergie potentielle diminue autant que l''énergie cinétique augmente.',0,4,2);
INSERT INTO "item" VALUES(99,18,'La somme des énergies potentielles et cinétiques se nomme l''énergie mécanique.',0,5,2);
INSERT INTO "item" VALUES(100,18,'L''énergie cinétique est égale à la moitié du produit de la masse par la vitesse au carré. Ec=0,5.m.v²',0,6,2);
INSERT INTO "item" VALUES(101,18,'L''énergie cinétique croît plus rapidement que la vitesse, la distance de freinage augmente avec l''énergie cinétique.',0,7,2);
INSERT INTO "item" VALUES(102,19,'Mesurer une longueur avec précision',0,1,2);
INSERT INTO "item" VALUES(103,19,'Mesurer un déplacement',0,2,2);
INSERT INTO "item" VALUES(104,19,'Mesurer ou calculer une durée',0,3,2);
INSERT INTO "item" VALUES(105,19,'Mesurer/calculer une vitesse',0,4,2);
INSERT INTO "item" VALUES(106,19,'Calculer une accéleration',0,5,2);
INSERT INTO "item" VALUES(107,19,'Utilisation de vecteurs',0,6,2);
INSERT INTO "item" VALUES(108,19,'addition, produit scalaire,projection',0,7,2);
INSERT INTO "item" VALUES(109,19,'logiciel de pointage',0,8,2);
INSERT INTO "item" VALUES(110,20,'Les ondes mécaniques se propagent grâce aux molécules qui vibrent de proches en proches.',0,1,2);
INSERT INTO "item" VALUES(111,20,'Le son se propage dans l''air à environ 340m/s.',0,2,2);
INSERT INTO "item" VALUES(112,20,'Les fréquences sonores vont des infrasons aux ultrasons en passant par les fréquences audibles.',0,3,2);
INSERT INTO "item" VALUES(113,21,'Un objet émettant de la lumière est appelé émetteur ou source primaire de lumière.',0,1,2);
INSERT INTO "item" VALUES(114,21,'Un objet diffuse la lumière qui l''éclaire.',0,2,2);
INSERT INTO "item" VALUES(115,21,'Un objet peut absorber certaines couleurs et en transmettre d''autres: ce sont des filtres colorés.',0,3,2);
INSERT INTO "item" VALUES(116,21,'Un objet peut absorber certaines couleurs et en diffuser d''autres.',0,4,2);
INSERT INTO "item" VALUES(117,21,'La couleur d''un objet dépend des rayonnements qu''il diffuse et donc de la lumière qui l''éclaire.',0,5,2);
INSERT INTO "item" VALUES(118,21,'Quand un objet absorbe de la lumière, il transforme très souvent cette énergie en chaleur.',0,6,2);
INSERT INTO "item" VALUES(119,22,'La lumière se propage dans le vide et les milieux transparents (l''air, le verre…)',0,1,2);
INSERT INTO "item" VALUES(120,22,'La lumière se propage de façon rectiligne (dans un milieu uniforme).',0,2,2);
INSERT INTO "item" VALUES(121,22,'Le trajet rectiligne de la lumière peut être modélisé par le rayon lumineux.',0,3,2);
INSERT INTO "item" VALUES(122,22,'La vitesse de la lumière dans le vide est de 300 000 km/s.',0,4,2);
INSERT INTO "item" VALUES(123,22,'Une année de lumière correspond à la distance que parcourt la lumière en une année. C''est une unité pratique en astronomie.',0,5,2);
INSERT INTO "item" VALUES(124,22,'Quand on reçoit un signal lumineux venant de très loin, il a été envoyé il y a très longtemps. Voir loin, c''est voir dans le passé.',0,6,2);
INSERT INTO "item" VALUES(125,22,'Un rayon passant d''un milieu transparent à un autre peut changer de direction. On appelle ce phénomène la réfraction.',0,7,2);
INSERT INTO "item" VALUES(126,22,'L''angle du rayon refracté dépend de l''indice de réfraction, noté n.',0,8,2);
INSERT INTO "item" VALUES(127,22,'La loi de Snell-Descartes lie l''angle incident, l''angle réfracté et les deux indices des milieux par la relation n<sub>1</sub> . sin(i<sub>1</sub>) = n<sub>2</sub> . sin(i<sub>2</sub>)',0,9,2);
INSERT INTO "item" VALUES(128,22,'Dans certains cas, il arrive qu''un rayon arrivant sur un milieu transparent soit entièrement réfléchi, c''est la réflexion totale.',0,10,2);
INSERT INTO "item" VALUES(129,23,'Notions simples de géométrie',0,1,2);
INSERT INTO "item" VALUES(130,23,'Axe orienté et mesures algébriques',0,2,2);
INSERT INTO "item" VALUES(131,24,'Une ombre est une zone non éclairée qui apparaît sombre par rapport à ses alentours qui sont éclairés.',0,1,2);
INSERT INTO "item" VALUES(132,24,'Une source lumineuse ponctuelle et un objet opaque déterminent deux zones:une zone éclairée et une zone d''ombre.',0,2,2);
INSERT INTO "item" VALUES(133,24,'Une ombre apparaît sur la face d''un objet éclairé sur l''autre face. C''est l''ombre propre.',0,3,2);
INSERT INTO "item" VALUES(134,24,'La projection sur une surface de l''ombre d''un objet s''appelle l''ombre portée.',0,4,2);
INSERT INTO "item" VALUES(135,24,'Lorsque la Lune est nouvelle(elle n''est pas visible),on voit l''ombre propre de la Lune. Les croissants de Lune sont dûs à l''éclairage oblique par le Soleil.',0,5,2);
INSERT INTO "item" VALUES(136,24,'Les éclipses solaires et lunaires surviennent quand l''ombre portée de la Lune se voit sur la Terre et inversement.',0,6,2);
INSERT INTO "item" VALUES(137,25,'Une lentille convergente fait converger les rayons lumineux et a les bords plus minces que le centre.',0,1,2);
INSERT INTO "item" VALUES(138,25,'La lentille convergente fait apparaître les objets plus gros.',0,2,2);
INSERT INTO "item" VALUES(139,25,'Une lentille convergente fait converger les rayons lumineux venant de loin en son foyer.',0,3,2);
INSERT INTO "item" VALUES(140,25,'La distance entre le centre de la lentille et son foyer est appelé distance focale.',0,4,2);
INSERT INTO "item" VALUES(141,25,'Une lentille convergente permet d''obtenir une image renversée sur un écran.Cette image ne sera nette que dans certaines positions.',0,5,2);
INSERT INTO "item" VALUES(142,26,'Une lentille divergente permet de faire diverger les rayons lumineux et a des bords plus épais que son centre.',0,1,2);
INSERT INTO "item" VALUES(143,26,'La lentille divergente fait apparaître les objets plus petits.',0,2,2);
INSERT INTO "item" VALUES(144,27,'Un objet ne peut être vu que si l''oeil reçoit de la lumière qui provient de cet objet.',0,1,2);
INSERT INTO "item" VALUES(145,27,'Une lumière trop intense peut endommager l''oeil. Le laser et le soleil ne doivent pas être regardés directement.',0,2,2);
INSERT INTO "item" VALUES(146,27,'Pour voir, nous avons besoin des capteurs de lumière sur la rétine pour envoyer l''information lumineuse au cerveau via le nerf optique.',0,3,2);
INSERT INTO "item" VALUES(147,27,'Le cristallin est équivalent à une lentille convergente, il sert à former une image sur la rétine.',0,4,2);
INSERT INTO "item" VALUES(148,27,'Il existe des ondes de même type que la lumière qu''on ne voit pas.Ce sont les ondes electro-magnétiques.',0,5,2);
INSERT INTO "item" VALUES(149,27,'L''ensemble des ondes électromagnétiques que l''on voit s''appelle le spectre visible.',0,6,2);
INSERT INTO "item" VALUES(150,27,'Nous avons à l''interieur de l''œil des capteurs (les cônes) sensibles au rouge, au vert et au bleu.',0,7,2);
INSERT INTO "item" VALUES(151,27,'Le cristallin peut se déformer et changer de distance focale en fonction de l’objet observé, c’est l’accomodation.',0,8,2);
INSERT INTO "item" VALUES(152,27,'Les lentilles déviant les rayons lumineux, on peut les utiliser pour aider les yeux malvoyants. Les lentilles sont les constituants principaux des lentilles de contact et des lunettes.',0,9,2);
INSERT INTO "item" VALUES(153,28,'Le spectre de la lumière solaire est continu, il va du rouge au violet sans interruption.',0,1,2);
INSERT INTO "item" VALUES(154,28,'On peut créer toutes les couleurs à partir des 3 rayonnements rouge,vert et bleu,on parle de synthèse additive.',0,2,2);
INSERT INTO "item" VALUES(155,28,'La lumière blanche est l''addition de toutes les lumières colorées du spectre visible.',0,3,2);
INSERT INTO "item" VALUES(156,28,'La couleur d''une lumière monochromatique dépend de sa longueur d''onde.',0,4,2);
INSERT INTO "item" VALUES(157,28,'Un objet chauffé va produire un spectre lumineux continu dont la longueur d''onde la plus intense est fonction de la température.',0,5,2);
INSERT INTO "item" VALUES(158,28,'Un prisme peut disperser la lumière en ses différentes longueurs d''onde car chacune a un indice différent.',0,6,2);
INSERT INTO "item" VALUES(159,28,'Quand la lumière passe à travers un gaz, certaines longueurs d''ondes sont absorbées.',0,7,2);
INSERT INTO "item" VALUES(160,28,'Quand on donne de l''énergie à un gaz, il produira de la lumière à certaines longueurs d''ondes particulières.',0,8,2);
INSERT INTO "item" VALUES(161,29,'Les éléments(ou atomes) sont les constituants de toute la matière connue.',0,1,2);
INSERT INTO "item" VALUES(162,29,'Les atomes sont symbolisés par une ou deux lettres dont la première est en majuscule et la seconde en minuscule.',0,2,2);
INSERT INTO "item" VALUES(163,29,'Une molécule est formée d''atomes liés entre eux.',0,3,2);
INSERT INTO "item" VALUES(164,30,'Les éléments sont constitués d''un noyau lourd chargé positivement autour duquel tournent des électrons chargés négativement.',0,1,2);
INSERT INTO "item" VALUES(165,30,'On reconnait l''élément à son nombre atomique(Z) correspondant au nombre de charges positives dans son noyau.',0,2,2);
INSERT INTO "item" VALUES(166,30,'Les atomes sont des éléments qui ont autant de charges positives que de charges négatives.',0,3,2);
INSERT INTO "item" VALUES(167,30,'L''atome est 10 000 fois plus gros que son noyau, l''atome est donc essentiellement constitué de vide.',0,4,2);
INSERT INTO "item" VALUES(168,30,'Le noyau est constitué de protons chargés positivement et de neutrons qui ne possèdent pas de charges électriques.',0,5,2);
INSERT INTO "item" VALUES(169,30,'Le nombre de masse (A) indique le nombre de constituants du noyau (aussi appelés nucléons).',0,6,2);
INSERT INTO "item" VALUES(170,30,'La masse d''un atome dépend de son nombre de masse car les nucléons pèsent bien plus que les électrons.',0,7,2);
INSERT INTO "item" VALUES(171,30,'Quand deux éléments identiques ont des nombres de masse différents, on dit qu''ils sont isotopes.',0,8,2);
INSERT INTO "item" VALUES(172,30,'La charge des protons et des électrons a pour valeur absolue 1,6.10<sup>-19</sup>Coulombs',0,9,2);
INSERT INTO "item" VALUES(173,31,'Le noyau des atomes contient de l''énergie',0,1,2);
INSERT INTO "item" VALUES(174,31,'La fission nucléaire est l''éclatement d''un noyau très lourd en plusieurs plus léger.',0,2,2);
INSERT INTO "item" VALUES(175,31,'La fission d''un noyau ne peut se prévoir que statistiquement.',0,3,2);
INSERT INTO "item" VALUES(176,31,'La fusion nucléaire est le rassemblement de plusieurs petits noyaux en un plus gros.',0,4,2);
INSERT INTO "item" VALUES(177,32,'Les électrons se répartissent par couches.',0,1,2);
INSERT INTO "item" VALUES(178,32,'Un élément sera plus stable s''il a sa couche externe complète.',0,2,2);
INSERT INTO "item" VALUES(179,32,'Les éléments d''une même famille chimique ont des propriétés similaires.',0,3,2);
INSERT INTO "item" VALUES(180,33,'Les ions sont des atomes qui ont gagné ou perdu un/des électrons.',0,1,2);
INSERT INTO "item" VALUES(181,33,'Les ions possèdent toujours une charge indiquée en exposant(exemple: Na<sup>+</sup>, Fe<sup>2+</sup>, Fe<sup>3+</sup>, Cu<sup>2+</sup>, Cl<sup>-</sup>)',0,2,2);
INSERT INTO "item" VALUES(182,33,'Dans les solutions aqueuses, ce sont les ions qui transmettent le courant électrique en se déplaçant.',0,3,2);
INSERT INTO "item" VALUES(183,34,'Avoir une tenue adaptée',0,1,2);
INSERT INTO "item" VALUES(184,34,'Aménager un espace dégagé',0,2,2);
INSERT INTO "item" VALUES(185,34,'Manipulation du matériel',0,3,2);
INSERT INTO "item" VALUES(186,34,'Adopter les bons gestes.',0,4,2);
INSERT INTO "item" VALUES(187,35,'Le pH est une échelle de 0 à 14 indiquant le caractère acide ou basique d''une solution. Le pH sera dit neutre (ni acide, ni basique) à 7 . Au dessous, il sera acide, au dessus, il sera basique.',0,1,2);
INSERT INTO "item" VALUES(188,35,'Les ions H<sup>+</sup> sont responsables de l''acidité d''une solution. Plus ils sont nombreux, plus la solution est acide et aura un pH faible.',0,2,2);
INSERT INTO "item" VALUES(189,35,'Les ions OH<sup>-</sup> sont responsables de la basicité d''une solution. Plus ils sont nombreux, plus la solution sera basique et aura un pH élevé.',0,3,2);
INSERT INTO "item" VALUES(190,35,'Les produits acide ou basique concentrés sont dangereux.',0,4,2);
INSERT INTO "item" VALUES(191,35,'L''acide chlorhydrique contient des ions hydrogènes(H<sup>+</sup>) et des ions chlorures(Cl<sup>-</sup>).',0,5,2);
INSERT INTO "item" VALUES(192,36,'Les métaux les plus courants sont le Fer, le Zinc,le Cuivre, l''Aluminium, l''Argent et l''Or.',0,1,2);
INSERT INTO "item" VALUES(193,36,'Les métaux sont constitués d''un seul type d''atome.',0,2,2);
INSERT INTO "item" VALUES(194,36,'Les charges opposées s''attirent et le charges de même signe se repoussent.',0,3,2);
INSERT INTO "item" VALUES(195,36,'Dans les solides, le courant électrique est dû à un déplacement d''électrons.',0,4,2);
INSERT INTO "item" VALUES(196,36,'Les metaux sont de bons conducteurs car ils possèdent des électrons faiblement liés à leur noyau.',0,5,2);
INSERT INTO "item" VALUES(197,36,'Les électrons vont du - au +, soit dans le sens opposé au courant électrique.',0,6,2);
INSERT INTO "item" VALUES(198,37,'La masse représente la quantité de matière d''un objet.',0,1,2);
INSERT INTO "item" VALUES(199,37,'Toutes les molécule d''eau sont identiques et ont la même masse',0,2,2);
INSERT INTO "item" VALUES(200,37,'Le volume  représente la portion d''espace occupé par un objet.',0,3,2);
INSERT INTO "item" VALUES(201,37,'1 litre d''eau liquide pèse 1 kilogramme.',0,4,2);
INSERT INTO "item" VALUES(202,37,'La masse volumique est le rapport de la masse sur le volume.',0,5,2);
INSERT INTO "item" VALUES(203,37,'La densité compare la masse volumique d''une espèce chimique à celle de l''eau.',0,6,2);
INSERT INTO "item" VALUES(204,38,'nommer la verrerie et les instruments de mesure',0,1,2);
INSERT INTO "item" VALUES(205,38,'Effectuer une pesée',0,2,2);
INSERT INTO "item" VALUES(206,38,'Mesurer un volume',0,3,2);
INSERT INTO "item" VALUES(207,38,'Schématiser une expérience',0,4,2);
INSERT INTO "item" VALUES(208,38,'Chromatographie',0,5,2);
INSERT INTO "item" VALUES(209,39,'Les molécules s''attirent entre elles et peuvent facilement se transmettre de l’énergie en se heurtant.',0,1,2);
INSERT INTO "item" VALUES(210,39,'Quand on donne de l’énergie à une molécule, elle s’agite davantage.',0,2,2);
INSERT INTO "item" VALUES(211,39,'Plus la température est haute,plus les molécules bougent vite. La température se mesure en degrès Celsius (°C).',0,3,2);
INSERT INTO "item" VALUES(212,39,'Une molécule a besoin d''une certaine agitation pour pouvoir échapper à l''attraction des autres molécules.',0,4,2);
INSERT INTO "item" VALUES(213,39,'L''eau pure gèle à 0°C et se vaporise à 100°C à la pression atmosphérique.',0,5,2);
INSERT INTO "item" VALUES(214,39,'Les changements d''états absorbent ou donnent de l''énergie.',0,6,2);
INSERT INTO "item" VALUES(215,39,'Les changements d''états ne se produisent pas à la même température quand on change la pression.',0,7,2);
INSERT INTO "item" VALUES(216,40,'Dans un solide, les molécules sont liées les unes aux autres et ne peuvent bouger les unes par rapport aux autres.',0,1,2);
INSERT INTO "item" VALUES(217,40,'Dans un liquide,les molécules peuvent bouger les unes par rapport aux autres.',0,2,2);
INSERT INTO "item" VALUES(218,40,'Les liquides ont leur surface libre horizontale.',0,3,2);
INSERT INTO "item" VALUES(219,40,'Dans un gaz les molécules s''entrochoquent entre elles. Elles vont très vite.',0,4,2);
INSERT INTO "item" VALUES(220,40,'Les gaz occupent tout le volume offert, on peut donc les compresser et les expanser facilement.',0,5,2);
INSERT INTO "item" VALUES(221,40,'Un volume de gaz possède une masse.',0,6,2);
INSERT INTO "item" VALUES(222,40,'Si on agite les molécules d''eau à l''état solide, elle vont fondre(passer à l''état liquide) puis se vaporiser (passer à l''état gazeux).',0,7,2);
INSERT INTO "item" VALUES(223,40,'Si on refroidit de la vapeur d''eau, elle va se liquéfier(passer à l''état liquide) puis se solidifier (devenir solide).',0,8,2);
INSERT INTO "item" VALUES(224,40,'Lorsque l''eau change d''état, le nombre de molécules reste le même, la masse est donc conservée.<br/> Par contre, elle ne s’organisent pas de la même façon, le volume occupé est donc différent.',0,9,2);
INSERT INTO "item" VALUES(225,40,'Une fumée est constituée de solides (assez gros pour être visibles) , ce n''est donc pas un gaz.',0,10,2);
INSERT INTO "item" VALUES(226,41,'Le sulfate de cuivre anhydre(sec) passe de blanc à bleu en présence d''eau.',0,1,2);
INSERT INTO "item" VALUES(227,41,'L''eau est omniprésente, notamment dans les boissons et les êtres vivants.',0,2,2);
INSERT INTO "item" VALUES(228,41,'Les nuages viennent de l''évaporation de l''eau en mer et sur les continents.',0,3,2);
INSERT INTO "item" VALUES(229,41,'L''eau sur les continents vient des nuages sous forme de pluie, de grêle ou de neige.',0,4,2);
INSERT INTO "item" VALUES(230,42,'Un corps pur ne contient qu''un seul type de molécules.',0,1,2);
INSERT INTO "item" VALUES(231,42,'Un mélange contient plusieurs types de molécules différentes.',0,2,2);
INSERT INTO "item" VALUES(232,43,'Un solide capable de se dissoudre dans un liquide est qualifié de soluble. Sinon, il est insoluble.',0,1,2);
INSERT INTO "item" VALUES(233,43,'Une solution désigne un liquide qui contient plus d''un corps pur.Lors d''une dissolution, on appellera le liquide le solvant et le solide qui se dissout le soluté.',0,2,2);
INSERT INTO "item" VALUES(234,43,'La masse d''une solution est la masse du solvant plus celle des solutés.',0,3,2);
INSERT INTO "item" VALUES(235,43,'Lors d''une dissolution, les molécules du soluté se détachent les unes des autres.',0,4,2);
INSERT INTO "item" VALUES(236,43,'Une solution saturée contient trop de soluté par rapport à la possibilité d''absorption du solvant.',0,5,2);
INSERT INTO "item" VALUES(237,43,'La dissolution d''un soluté ionique donnera une solution neutre contenant des ions.',0,6,2);
INSERT INTO "item" VALUES(238,44,'On peut voir plusieurs constituants dans un mélange hétérogène.',0,1,2);
INSERT INTO "item" VALUES(239,44,'La décantation permet de séparer les composants solides d''un liquide en les laissant tomber au fond sous l''action de leurs poids.',0,2,2);
INSERT INTO "item" VALUES(240,44,'La filtration permet de retenir tout ce qui est plus gros que les mailles du filtre, les solides en général.',0,3,2);
INSERT INTO "item" VALUES(241,45,'On ne peut pas distinguer les différents constituants d''un mélange homogène. Il paraît n''être constitué que d''un seul constituant.',0,1,2);
INSERT INTO "item" VALUES(242,45,'Une eau d''apparence homogène peut contenir des substances autres que l''eau.(solides ou gaz dissous,liquide miscible)',0,2,2);
INSERT INTO "item" VALUES(243,45,'L''eau et certains liquides sont miscibles, cela signifie qu''on peut les mélanger.',0,3,2);
INSERT INTO "item" VALUES(244,45,'Quand on distille une eau, on sépare l''eau pure (rien d''autre que des molécules d''eau) de tout le reste (minéraux...).',0,4,2);
INSERT INTO "item" VALUES(245,45,'L''eau de chaux se trouble lorsqu''elle est en présence de CO<sub>2</sub>.',0,5,2);
INSERT INTO "item" VALUES(246,45,'La chromatographie permet de séparer les différents constituants d''un mélange homogène grâce au fait que chaque composant "adhère" différemment à la plaque.',0,6,2);
INSERT INTO "item" VALUES(247,45,'Les méthodes d''extraction et de séparation visent à séparer plusieurs espèces chimiques présentes dans un mélange.',0,7,2);
INSERT INTO "item" VALUES(248,45,'Pour identifier un produit, on compare les propriétés d''une espèce chimique aux propriétés de l''espèce chimique qu''on cherche.',0,8,2);
INSERT INTO "item" VALUES(249,45,'La distillation fractionnée permet de séparer les molécules en fonction de leur température d''ébullition.',0,9,2);
INSERT INTO "item" VALUES(250,46,'La concentration massique indique la masse de soluté présente dans un litre de solution. Son unité est le g/L',0,1,2);
INSERT INTO "item" VALUES(251,46,'Une mole représente un groupe de 6.10<sup> 23</sup> éléments de même nature.',0,2,2);
INSERT INTO "item" VALUES(252,46,'La concentration molaire indique le nombre de moles de soluté présent dans un litre de solution. Son unité est le mol/L',0,3,2);
INSERT INTO "item" VALUES(253,46,'La masse molaire (M) indique la masse d''une mole d''une espèce chimique.',0,4,2);
INSERT INTO "item" VALUES(254,46,'La masse molaire d''une molécule est la sommes des masses molaires des atomes qui la composent.',0,5,2);
INSERT INTO "item" VALUES(255,46,'L''action d''un médicament dépendra de la formule du principe actif et de sa concentration.',0,6,2);
INSERT INTO "item" VALUES(256,46,'Une dilution ne change pas la quantité de matière d''une espèce chimique mais diminue sa concentration.',0,7,2);
INSERT INTO "item" VALUES(257,47,'La formule brute d''une molécule indique le nombre d''atomes présents dans la molécule. On indique le symbole de l''atome suivi de sa quantité en indice.(pas de chiffre indiqué signifie 1)',0,1,2);
INSERT INTO "item" VALUES(258,47,'Pour indiquer combien de molécules sont présentes, on met un chiffre devant la formule brute de la molécule.',0,2,2);
INSERT INTO "item" VALUES(259,47,'La formule développée représente toutes les liaisons présentes entre les atomes de la molécule.',0,3,2);
INSERT INTO "item" VALUES(260,47,'La formule semi-développée équivaut à la formule développée sauf qu''on ne représente pas les liaisons avec l''hydrogène.',0,4,2);
INSERT INTO "item" VALUES(261,47,'Deux molécules ayant des formules brutes identiques et de formules semi-développées différentes seront appelées isomères.',0,5,2);
INSERT INTO "item" VALUES(262,47,'Certains agencement d''atomes confèrent aux molécules des propriétés particulières, on les appelle des groupes fonctionnels.',0,6,2);
INSERT INTO "item" VALUES(263,48,'Les molécules organiques sont les molécules constituant les êtres vivants, elles sont composées de squelettes carbonées.',0,1,2);
INSERT INTO "item" VALUES(264,48,'Les lipides sont souvent constitué d''acides gras qui sont apolaires.',0,2,2);
INSERT INTO "item" VALUES(265,48,'Une molécule amphiphile est une molécule qui possède une partie polaire et une partie polaire.',0,3,2);
INSERT INTO "item" VALUES(266,49,'Quand plusieurs molécules échangent des atomes ou des liaisons chimiques, on parle de réaction chimique.',0,1,2);
INSERT INTO "item" VALUES(267,49,'Lors d''une réaction chimique, les atomes des réactifs se réarrangent pour former les produits. La quantité de réactifs diminue donc et la quantité de produits augmente.',0,2,2);
INSERT INTO "item" VALUES(268,49,'L''équation de la réaction précise le sens de la transformation. La flèche va des réactifs aux produits.',0,3,2);
INSERT INTO "item" VALUES(269,49,'Pour qu''une équation puisse être réelle, on doit s''assurer qu''elle soit équilibrée.',0,4,2);
INSERT INTO "item" VALUES(270,49,'Comme tous les atomes sont conservés au cours d''une réaction chimique, la masse totale est conservée.',0,5,2);
INSERT INTO "item" VALUES(271,49,'Pour connaître les quantitées de réactifs et de produits lors d''une réaction, on indique les quantités de chaque espèce chimique sous l''équation-bilan.',0,6,2);
INSERT INTO "item" VALUES(272,50,'Une oxydation se produit quand une espèce chimique perd une partie de sa charge électrique négative.',0,1,2);
INSERT INTO "item" VALUES(273,50,'A part la photosynthèse, toute l''énergie chimique récupérée par les êtres vivants passe par l''oxydation des nutriments qu''ils consomment.',0,2,2);
INSERT INTO "item" VALUES(274,50,'Oxydant/réducteur',0,3,2);
INSERT INTO "item" VALUES(275,51,'Pour qu''une combustion ait lieu,il faut un combustible, un comburant (dioxygène de l''air) et une source de chaleur.On parle de triangle du feu.',0,1,2);
