INSERT INTO "item" VALUES(279,51,'Certaines combustions peuvent être dangereuses car très rapides. On dit qu''elles sont explosives.',0,5,2);
INSERT INTO "item" VALUES(280,51,'Certaines combustions peuvent être incomplètes et libérer des produits dangereux pour la santé.(monoxyde de carbone CO)',0,6,2);
