PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE classroom (id INTEGER NOT NULL, refUia INTEGER NOT NULL, label VARCHAR(255) NOT NULL, PRIMARY KEY(id));
CREATE TABLE domain (id INTEGER NOT NULL, label VARCHAR(255) NOT NULL, PRIMARY KEY(id));
CREATE TABLE evaluation (id INTEGER NOT NULL, uia INTEGER NOT NULL, refuser INTEGER NOT NULL, title VARCHAR(255) NOT NULL, createdate VARCHAR(255) NOT NULL, updatedate VARCHAR(255) NOT NULL, PRIMARY KEY(id));
CREATE TABLE item (id INTEGER NOT NULL, refTheme INTEGER NOT NULL, label VARCHAR(255) NOT NULL, type INTEGER NOT NULL, lvl INTEGER NOT NULL, status INTEGER NOT NULL, PRIMARY KEY(id));

',0,5,2);

