CREATE TABLE question (id INTEGER NOT NULL, refEvaluation INTEGER NOT NULL, title VARCHAR(255) NOT NULL, taxo INTEGER NOT NULL, point INTEGER NOT NULL, item1 INTEGER NOT NULL, item2 INTEGER NOT NULL, PRIMARY KEY(id));
CREATE TABLE theme (id INTEGER NOT NULL, refDomain INTEGER NOT NULL, label VARCHAR(255) NOT NULL, PRIMARY KEY(id));
CREATE TABLE uia (id INTEGER NOT NULL, slug VARCHAR(255) NOT NULL, name VARCHAR(255) NOT NULL, address VARCHAR(255) NOT NULL, city VARCHAR(255) NOT NULL, dept VARCHAR(255) NOT NULL, region VARCHAR(255) NOT NULL, chiefidentity VARCHAR(255) NOT NULL, logourl VARCHAR(255) NOT NULL, PRIMARY KEY(id));
CREATE TABLE user (id INTEGER NOT NULL, refUia INTEGER NOT NULL, login VARCHAR(255) NOT NULL, email VARCHAR(255) NOT NULL, password VARCHAR(255) NOT NULL, isAdmin INTEGER NOT NULL, isModerator INTEGER NOT NULL, isProfessor INTEGER NOT NULL, realName VARCHAR(255) NOT NULL, connectTime VARCHAR(255) NOT NULL, registerTime VARCHAR(255) NOT NULL, token VARCHAR(255) NOT NULL, status INTEGER NOT NULL, birthdate VARCHAR(255) NOT NULL, PRIMARY KEY(id));
CREATE TABLE userclass (id INTEGER NOT NULL, refUia INTEGER NOT NULL, refUser INTEGER NOT NULL, refClassroom INTEGER NOT NULL, PRIMARY KEY(id));
CREATE TABLE answer (id INTEGER NOT NULL, refUia INTEGER NOT NULL, refEval INTEGER NOT NULL, refUser INTEGER NOT NULL, answer VARCHAR(255) NOT NULL, PRIMARY KEY(id));
COMMIT;
